import React from "react";
import PropTypes from "prop-types";

const Section = ({ title, children }) => {
    return (
        <section>
            {title && <h2>{title}</h2>}
            {children}
        </section>
    )
}

Section.propTypes = {
  title: PropTypes.string,
  children: PropTypes.element,
};

export default Section
